{"post_stream":{"posts":[{"id":3326346,"name":"Rocky","username":"Rocky_S","avatar_template":"/user_avatar/www.chiefdelphi.com/rocky_s/{size}/220194_2.png","created_at":"2024-03-07T00:27:17.391Z","cooked":"<p>Hello Intellgent people of <span class="abbreviation">FRC<template class="tooltiptext" data-text="FIRST Robotics Competition"></template></span> community!</p>
<p>For this year, we have 2 Kraken motors for our shooter, and we want them to spin as fast as possible.</p>
<p>According to the datasheet, the max <span class="abbreviation">RPM<template class="tooltiptext" data-text="Revolutions Per Minute"></template></span> for Kraken motor is 6k <span class="abbreviation">RPM<template class="tooltiptext" data-text="Revolutions Per Minute"></template></span>, but our current max <span class="abbreviation">RPM<template class="tooltiptext" data-text="Revolutions Per Minute"></template></span> seems to be 3k <span class="abbreviation">RPM<template class="tooltiptext" data-text="Revolutions Per Minute"></template></span>. Would anyone like to share the <span class="abbreviation">RPM<template class="tooltiptext" data-text="Revolutions Per Minute"></template></span> for their kraken shooters?</p>
<p>Also we are using a <span class="abbreviation">PID<template class="tooltiptext" data-text="Proportional Integral Derivative"></template></span> controller to a setpoint for the <span class="abbreviation">RPM<template class="tooltiptext" data-text="Revolutions Per Minute"></template></span> for our krakens, here’s the Shooter subsystem. It has 2 krakens for flywheel-shooting, and 1 Neo motor with 1 Rev through-bore-encoder in absolute mode connected to the sparkMax for the tilting of the shooter/pivot.</p>
<pre><code class="lang-auto">package frc.robot.subsystems;
import java.net.CacheRequest;

import com.ctre.phoenix6.configs.Slot0Configs;
import com.ctre.phoenix6.configs.TalonFXConfiguration;
import com.ctre.phoenix6.configs.TalonFXConfigurator;
