<p>Set your shooters to 100% raw Vbus (<code>motor.set</code>). Log the <span class="abbreviation">RPM<template class="tooltiptext" data-text="Revolutions Per Minute"></template></span>, and that’s your max <span class="abbreviation">RPM<template class="tooltiptext" data-text="Revolutions Per Minute"></template></span>. Divide the commanded voltage (should be ~12V, check logs to make sure) by the max RPS (NOT <span class="abbreviation">RPM<template class="tooltiptext" data-text="Revolutions Per Minute"></template></span>) and that’s your kV value. See this page for more details:</p>
